class Solution(object):    def flipAndInvertImage(self, A):        """        :type A: List[List[int]]        :rtype: List[List[int]]        """        if len(A)==0:            return A        elif len(A[0])==0:            return A        B=[]        for line in A:            line.reverse()            B.append(line)        for i in range(len(B)):            for j in range(len(B[0])):                if B[i][j]==0:                    B[i][j]=1                else:                    B[i][j]=0        return Bsolution=Solution()A=[[1,1,0],[1,0,1],[0,0,0]]print(solution.flipAndInvertImage(A))